import React from 'react';
import BookCard from '../BookCard';
import './index.css';

const BookList = (bookList) => {
    return (
        <div className="book-container">
            {
                bookList.map((book, index) => {
                    (
                        <BookCard book={ book } />
                    )
                })
            }
            {/* <Books bookList={ this.state.bookList } /> */}
        </div>
    );
};

export default BookList;
